import React,{useState,useEffect} from 'react'
import { useDispatch,useSelector} from 'react-redux'
import Subscription from '../components/Subscription'
import { Row,Col } from 'react-bootstrap'
import {listSubscriptions} from '../actions/subActions'
import axios from 'axios'


function Home() {
    const dispatch =useDispatch()

    useEffect(() => {
        dispatch(listSubscriptions())

    }, [])

const subscriptions=[
    {
        "_id": 1,
        "name": "Basic",
        "image": "/images/basic_1IMgkUY.png",
        "description": "Basic, starter plan",
        "price": "1000.00",
        "duration": 30,
        "features": "Partial site access",
        "user": 1
    },]

    return (
        <div>
            <h1>Subscriptions</h1>
            <Row>
                {subscriptions.map(subscription => (
                    <Col key={subscription._id} sm={12} md={6} xl={3}>
                        <Subscription subscription={subscription} />
                    </Col>
                ))}
            </Row>
        </div>
    )
}

export default Home
